  "text" : "いやもちろん自分だって普通の日本の社会という集団の中の個人ですけど、でもそれよりもっと狭い、例えば会社とか友達グループとか有名人とか、そういう集団の中の制約条件みたいなキツさを感じてる人は、「Twitterは自由だ！」って言っても自由に振舞えないんだろうなぁと。",
