  "text" : "5ゲーム＝15曲ぐらいやったけど、もう手（具体的には手首より手前側外側の腕の筋肉）が限界です。たくさん文タイピングしすぎて疲れた時と同じ感じ。片手うちは諸刃の剣やわー。 #REFLECBEAT",
